'''Mark Michael Hutchinson''' is an English actor who won the 1993 [[Drama Desk Award for Outstanding Featured Actor in a Musical]] for his performance as Eddie in ''[[Blood Brothers (musical)|Blood Brothers]]''.<ref>{{Cite web|title=Mark Michael Hutchinson|url=http://www.playbill.com/person/mark-michael-hutchinson-vault-0000064940|access-date=2020-06-09|website=Playbill|language=en}}</ref><ref>{{Cite web|title=Mark Michael Hutchinson Biography on BroadwayWorld.com|url=https://www.broadwayworld.com/people/bio/Mark-Michael-Hutchinson/|access-date=2020-06-09|website=www.broadwayworld.com}}</ref>

His partner was the British comedian and actor [[Tony Slattery]].<ref>{{Cite news|url=https://www.theguardian.com/lifeandstyle/2019/apr/29/tony-slattery-had-very-happy-time-went-slightly-barmy|title=Tony Slattery: 'I had a very happy time until I went slightly barmy'|last=Freeman|first=Hadley|date=2019-04-29|work=The Guardian|access-date=2019-04-29|language=en-GB|issn=0261-3077}}</ref> They met while performing in the musical ''[[Me and My Girl]]'' in the West End in 1986.<ref>{{cite news|title='Please Don't Write That I Am A Survivor'|publisher=Daily Telegraph|date=19 July 2017|author=Dominic Cavendish}}</ref>

