'''Rachel Ashley Platten'''<ref>{{cite web|url=http://repertoire.bmi.com/writer.asp?blnWriter=True&blnPublisher=True&blnArtist=True&page=1&fromrow=1&torow=25&querytype=WriterID&keyid=1013619&keyname=PLATTEN+RACHEL+ASHLEY&CAE=494825608&Affiliation=BMI|title=Songwriter/Composer: Platten Rachel Ashley|publisher=Broadcast Music, Inc.|access-date=June 7, 2015|url-status=dead|archive-url=https://web.archive.org/web/20160202155238/http://repertoire.bmi.com/writer.asp?blnWriter=True&blnPublisher=True&blnArtist=True&page=1&fromrow=1&torow=25&querytype=WriterID&keyid=1013619&keyname=PLATTEN+RACHEL+ASHLEY&CAE=494825608&Affiliation=BMI|archive-date=February 2, 2016|df=mdy-all}}</ref> (born May 20, 1981) is an American singer-songwriter and author. After releasing two albums independently in 2003 and 2011, she signed with [[Columbia Records]] in 2015 and released her mainstream debut single, "[[Fight Song (Rachel Platten song)|Fight Song]]", which peaked at number 6 on the [[Billboard Hot 100|''Billboard'' Hot 100]] in the United States, topped charts in the United Kingdom, and peaked within the top ten of multiple charts worldwide. Platten won a [[Daytime Emmy Award]] for a live performance of the song on ''[[Good Morning America]]''. Her major-label debut studio album, ''[[Wildfire (Rachel Platten album)|Wildfire]]'' (2016), was certified [[RIAA certification|gold]] by the [[Recording Industry Association of America]] (RIAA) and featured the follow-up singles "[[Stand by You (Rachel Platten song)|Stand by You]]" and "[[Better Place (Rachel Platten song)|Better Place]]". Her second major-label album, ''[[Waves (Rachel Platten album)|Waves]] (2017)'', followed a year later.

Outside of music Platten appeared as a model in clothing brand [[Aerie (clothing retailer)|Aerie]]'s advertising campaign in photos that have not been [[Photograph manipulation|retouched]].<ref name=":3" /> She appeared on the cover of ''[[The Improper Bostonian]]'' magazine's May 2018 issue.<ref name=":4" /> Platten has supported numerous charities, including, Music Unites, [[Ryan Seacrest]] Foundation, [[Autism Speaks]], [[Los Angeles LGBT Center]], [[Memorial Sloan Kettering Cancer Center|Memorial Sloan-Kettering]], [[Boys & Girls Clubs of America]], [[BuildOn]], and [[Live Below the Line]].<ref name=":5" /> She has worked with Musicians on Call since the early 2000s, and is part of a program where she sings bedside to hospital patients.<ref name=":6" /> Platten has volunteered for over 50 Musicians On Call programs.<ref name=":7" /> The organization honored Platten for her volunteer work with Music Heals Award at a benefit event on December 1, 2015.<ref name=":2" /> Platten performed at Global Down Syndrome Foundation's virtual fashion show on November 14, 2020.<ref name=":8" />

